	check_model_version(NNOM_MODEL_VERSION);
	new_model(&model);

	layer[0] = input_s(&gru_39_input_config);
	layer[1] = model.hook(rnn_s(gru_cell_s(&gru_39_gru_cell_config), &gru_39_config), layer[0]);
